import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    let name= 'Marco';
    let green = 'grey'; 
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p style={{color: green}}>
            Hello {name}!!
          </p>
          <a
            className="App-link"
            href="https://www.switch-brasil.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            Link to Switch Brasil
          </a>
        </header>
      </div>
    );
  }
}

export default App;
